int
parent (int i)
{
  return i - 1 / 2;
}

int
leftChild (int i)
{
  return (2 * i) + 1;
}

int
rightChild (int i)
{
  return (2 * i) + 2;
}

void ShiftUp (int i)
{
  int parent;
  if(i<=2){
    parent = 0;
  }
  
  if(i % 2 != 0)
    {
      parent = i / 2;
    }
  if(i % 2 == 0)
    {
      parent = (i - 1) / 2;
    }

  while (i > 0 && H[parent] < H[i])
    {
      int tem = H[parent];
      H[parent] = H[i];
      H[i] = tem;
      i = parent;
      ShiftUp (i);
    }
}

void ShiftDown (int i)
{
  if(2*i<=size)
  {
      maxIndex = i;
      l = leftChild (i);
      if (l <= size && H[l] > H[maxIndex])
	{
	  maxIndex = l;
	}

      r = rightChild (i);
      if (r<=size && H[r]>H[maxIndex]){
	  maxIndex = r;
	  }

      if (i!= maxIndex)
	{
	  int temp = H[i];
	  H[i] = H[maxIndex];
	  H[maxIndex] = temp;
      i = maxIndex;
      ShiftDown (i);
    }
}
}

